import React, { useState, useEffect, useRef } from 'react';
import axios from 'axios';
import * as XLSX from 'xlsx';
import './ITEquipment.css';

const ITEquipment = () => {
  const [itEquipments, setITEquipments] = useState([]);
  const [newEquipment, setNewEquipment] = useState({
    categorie: '',
    marque: '',
    model: '',
    code_materiel: '',
    serie: '',
    code_localisation: '',
    code_entite: '',
    date_installation: '',
    fin_garantie: '',
    statut: '',
    type_acquisition: '',
    date_achat: '',
    date_livraison: '',
    fournisseur: '',
    numero_facture: '',
    prix_achat: '',
    numero_appel_offre: '',
    numero_livraison: '',
    cout_maintenance: '',
    emploi_principal: '',
    niveau_criticite: '',
    sla: '',
    date_sortie: '',
  });
  const [fileName, setFileName] = useState('');
  const [sheets, setSheets] = useState([]);
  const [selectedSheet, setSelectedSheet] = useState(null);
  const [workbook, setWorkbook] = useState(null);

  useEffect(() => {
    const fetchITEquipments = async () => {
      try {
        const response = await axios.get('/api/it-equipments');
        setITEquipments(response.data);
      } catch (error) {
        console.error('Error fetching IT Equipments:', error);
      }
    };

    fetchITEquipments();
  }, []);

  const handleAddEquipment = async () => {
    try {
      const response = await axios.post('/api/it-equipments', newEquipment);
      setITEquipments([...itEquipments, response.data]);
      setNewEquipment({
        categorie: '',
        marque: '',
        model: '',
        code_materiel: '',
        serie: '',
        code_localisation: '',
        code_entite: '',
        date_installation: '',
        fin_garantie: '',
        statut: '',
        type_acquisition: '',
        date_achat: '',
        date_livraison: '',
        fournisseur: '',
        numero_facture: '',
        prix_achat: '',
        numero_appel_offre: '',
        numero_livraison: '',
        cout_maintenance: '',
        emploi_principal: '',
        niveau_criticite: '',
        sla: '',
        date_sortie: '',
      });
      alert('Equipment added successfully!');
    } catch (error) {
      console.error('Error adding IT Equipment:', error);
    }
  };

  const handleDeleteEquipment = async (id) => {
    try {
      await axios.delete(`/api/it-equipments/${id}`);
      setITEquipments(itEquipments.filter(equipment => equipment.id !== id));
    } catch (error) {
      console.error('Error deleting IT Equipment:', error);
    }
  };

  const handleChange = (e) => {
    setNewEquipment({ ...newEquipment, [e.target.name]: e.target.value });
  };

  const handleFileUpload = (e) => {
    const file = e.target.files[0];
    setFileName(file.name);
    const reader = new FileReader();
    reader.onload = (event) => {
      const binaryStr = event.target.result;
      const newWorkbook = XLSX.read(binaryStr, { type: 'binary' });

      const sheetNames = newWorkbook.SheetNames.map((sheetName, index) => ({
        value: index,
        label: sheetName,
      }));
      setSheets(sheetNames);
      setWorkbook(newWorkbook); // Set the workbook state
      setSelectedSheet(sheetNames[0].value);

      handleSheetChange(newWorkbook, sheetNames[0].value);
    };
    reader.readAsBinaryString(file);
  };

  const handleSheetChange = (workbook, sheetIndex) => {
    const sheetName = workbook.SheetNames[sheetIndex];
    const sheet = workbook.Sheets[sheetName];
    const jsonData = XLSX.utils.sheet_to_json(sheet, { defval: '', header: 1 });
    const [headers, ...rows] = jsonData;

    const formattedData = rows.map((row) => {
      const rowData = {};
      headers.forEach((header, index) => {
        rowData[header] = row[index];
      });
      return rowData;
    });

    formattedData.forEach(async (dataRow) => {
      try {
        const response = await axios.post('/api/it-equipments', dataRow);
        setITEquipments((prevEquipments) => [...prevEquipments, response.data]);
      } catch (error) {
        console.error('Error adding IT Equipment from Excel:', error);
      }
    });
  };

  return (
    <div className="it-equipment-manager">
      <h1>IT Equipment Manager</h1>
      <div className="add-equipment">
        {Object.keys(newEquipment).map((key) => (
          <input
            key={key}
            type="text"
            name={key}
            value={newEquipment[key]}
            onChange={handleChange}
            placeholder={key.replace(/_/g, ' ')}
          />
        ))}
        <button onClick={handleAddEquipment}>Add Equipment</button>
        <input type="file" onChange={handleFileUpload} className="file-input" />
      </div>
      <div className="table-container">
        <div className="data-table vertical">
          {itEquipments.map((equipment, index) => (
            <div key={equipment.id} className="data-row">
              <div className="data-row-header">#</div>
              <div className="data-row-content">{index + 1}</div>
              <div className="data-row-header">Categorie</div>
              <div className="data-row-content">{equipment.categorie}</div>
              <div className="data-row-header">Marque</div>
              <div className="data-row-content">{equipment.marque}</div>
              <div className="data-row-header">Model</div>
              <div className="data-row-content">{equipment.model}</div>
              <div className="data-row-header">Code Materiel</div>
              <div className="data-row-content">{equipment.code_materiel}</div>
              <div className="data-row-header">Serie</div>
